  false,\n\t\"url\": null,\n\t\"notes\": \"An aerial photograph is a photograph of
  the earth's surface taken with a camera mounted in an airplane. The geographic extent
  of this scanned, georectified, and mosaiced 1.5-meter pixel resolution color infrared
  (CIR) digital aerial photograph is approximately the Treasure Valley in Idaho. 43
  tiles acquired as part of the 1994 Treasure Valley Air Photo Project are included
  in this mosaic. The collection area includes almost all of Canyon county, portions
  of the north-western half of Ada county, the southern tip of Payette county, and
  a small portion of the south-western tip of Gem county. The 1:12,000-scale color
  infrared aerial photography used in the production of this mosaiced image was flown
  in July 1994 by Valley Air Photos, Caldwell, Idaho.\",\n\t\"license_title\": null,\n\t\"extras\":
